import ListTile from "./ListTile";
import "./List.css";
export default function List(props) {
  return (
    <div className="list">
      {props.data.map((userInfo) => (
        <ListTile key={userInfo.id} name={userInfo.name} age={userInfo.age} />
      ))}
    </div>
  );
}
